import{o as e,c as t,d as a}from"./app.36aa31b1.js";const o='{"title":"Import Guide","description":"","frontmatter":{},"headers":[{"level":3,"title":"1. Request your data from Spotify","slug":"_1-request-your-data-from-spotify"},{"level":3,"title":"2. Confirm your request","slug":"_2-confirm-your-request"},{"level":3,"title":"3. Wait till your data arrives in your email","slug":"_3-wait-till-your-data-arrives-in-your-email"},{"level":3,"title":"4. Get your import code","slug":"_4-get-your-import-code"},{"level":3,"title":"5. Download and extract the .ZIP file","slug":"_5-download-and-extract-the-zip-file"},{"level":3,"title":"6. Upload your files","slug":"_6-upload-your-files"},{"level":3,"title":"!Step 6 image","slug":"step-6-image-https-media-discordapp-net-attachments-830562126560231464-830562250447650816-step-6-png"},{"level":3,"title":"7. Download imported files to your device","slug":"_7-download-imported-files-to-your-device"},{"level":3,"title":"8. Ready to go!","slug":"_8-ready-to-go"}],"relativePath":"import/guide/index.md","lastUpdated":1624202248178}',r={},i=a('<h1 id="import-guide"><a class="header-anchor" href="#import-guide" aria-hidden="true">#</a> Import Guide</h1><h3 id="_1-request-your-data-from-spotify"><a class="header-anchor" href="#_1-request-your-data-from-spotify" aria-hidden="true">#</a> 1. Request your data from Spotify</h3><p>Navigate to <a href="https://www.spotify.com/account/privacy" target="_blank" rel="noopener noreferrer">spotify.com/account/privacy</a> (make sure you&#39;re on the privacy tab) and scroll down to &quot;Download your data&quot;. Then, click the &quot;Request&quot; button. <img src="https://media.discordapp.net/attachments/830562126560231464/830562246106677298/step-1.png" alt="Step 1 image"></p><h3 id="_2-confirm-your-request"><a class="header-anchor" href="#_2-confirm-your-request" aria-hidden="true">#</a> 2. Confirm your request</h3><p>Next, to download your data, you must send a request. Go over to your email and click &quot;confirm&quot;. <img src="https://media.discordapp.net/attachments/830562126560231464/830562247663288411/step-2.png" alt="Step 2 image"></p><h3 id="_3-wait-till-your-data-arrives-in-your-email"><a class="header-anchor" href="#_3-wait-till-your-data-arrives-in-your-email" aria-hidden="true">#</a> 3. Wait till your data arrives in your email</h3><p>As Spotify states:</p><blockquote><p>We are preparing your data file. This can take up to 30 days to complete. You&#39;ll receive an email when it is ready to download.</p></blockquote><p>But in 99% of the cases, you&#39;ll receive the data within ±3 days.</p><h3 id="_4-get-your-import-code"><a class="header-anchor" href="#_4-get-your-import-code" aria-hidden="true">#</a> 4. Get your import code</h3><p>To link your files to your account, you&#39;ll need to fill in a special import code. You can find your unique import code in the Spotistats app on the Manage imports page. &quot;Then copy (tap the code) or type the code into website. <img src="https://media.discordapp.net/attachments/830562126560231464/830562249177432134/step-4.png" alt="Step 4 image"></p><h3 id="_5-download-and-extract-the-zip-file"><a class="header-anchor" href="#_5-download-and-extract-the-zip-file" aria-hidden="true">#</a> 5. Download and extract the .ZIP file</h3><p>Once Spotify has sent you your data, it will be in a .ZIP file. This includes a lot of personal information which <strong>you should never share with others</strong><a href="https://www.youtube.com/watch?v=do3u3tXAbWQ" target="_blank" rel="noopener noreferrer">How to extract a .ZIP file</a></p><h3 id="_6-upload-your-files"><a class="header-anchor" href="#_6-upload-your-files" aria-hidden="true">#</a> 6. Upload your files</h3><p>When you have your .JSON files ready, click the &quot;Choose files&quot; button. Then, select <strong>all files starting with StreamingHistory</strong> (hold shift to select multiple files).</p><p>Note: depending on the number of files this can take a couple of seconds</p><h3 id=""><a class="header-anchor" href="#" aria-hidden="true">#</a> <img src="https://media.discordapp.net/attachments/830562126560231464/830562250447650816/step-6.png" alt="Step 6 image"></h3><h3 id="_7-download-imported-files-to-your-device"><a class="header-anchor" href="#_7-download-imported-files-to-your-device" aria-hidden="true">#</a> 7. Download imported files to your device</h3><p>The last step is to download your imported files onto your device. Simply click &quot;Download all imports to device&quot; and wait a couple of seconds while the app downloads and processes them. <img src="https://media.discordapp.net/attachments/830562126560231464/830562252725682236/step-7.png" alt="Step 7 image"></p><h3 id="_8-ready-to-go"><a class="header-anchor" href="#_8-ready-to-go" aria-hidden="true">#</a> 8. Ready to go!</h3><p>Congratulations! You can now view your full listening history, playcount, and more. Note, that this will only include the data you&#39;ve imported yourselves. If you want to update this data, start again at step 1 :‎)</p>',21);r.render=function(a,o,r,d,l,s){return e(),t("div",null,[i])};export default r;export{o as __pageData};
